def urlList(container_name):
    import os, uuid, sys
    from azure.storage.blob import BlockBlobService, PublicAccess
    block_blob_service = BlockBlobService(account_name='bosehomehub',
                                          account_key='c8zxDR7xZlZUux6bX+JLSYPUy8ufmE0aSc9BjanntW6b46GquV3EhVfqky61rD+3BjmFhCfapiJaNnWL5+8fSw==')

    generator = block_blob_service.list_blobs(container_name)
    l = list()
    for blob in generator:
        url = "https://bosehomehub.blob.core.windows.net/" + container_name + "/"
        url += blob.name
        l.append(url)
    print(l)
    return l

def convertToFile(base):
    import base64
    imgdata = base64.b64decode(base)
    import uuid
    img = uuid.uuid4().hex[:6].upper()
    filename = img + '.jpg'  # I assume you have a way of picking unique filenames
    with open(filename, 'wb') as f:
        f.write(imgdata)
    return filename


